import logo from './logo.svg';
import './App.css';

const App =() => {
  const name = "Russel";
  const nameshow = false;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
       <h1>Hello  {nameshow  ? name : 'someone'}</h1>
      </header>
    </div>
  );
}

export default App;
